import React from 'react';

class Module extends React.Component {
  render() {
    return (
      <div class="box Module">
        <h3 class="box__title Module__title">{this.props.title}</h3>
        <div class="Module__content">{this.props.content}</div>
      </div>
    );
  }
}

export default Module;
